                    <h3>Web Developer Junior</h3>
                    <h4>Septembre - Avril 2019 / Becode.org / Charleroi</h4>
                    <h5>Formation centrée sur les technologies du web : Html, Css, JavaScript, PHP, Wordpress, Mysql & framework</h5>
            </div>
            <div className="flex-row-center part2">
                <div className="flex-column-center">
                    <h3>Web Developer Junior</h3>
                    <h4>Septembre - Avril 2019 / Becode.org / Charleroi</h4>
                    <h5>Formation centrée sur les technologies du web : Html, Css, JavaScript, PHP, Wordpress, Mysql & framework</h5>
                </div>
                <div className="flex-column-center">
                    <h3>Web Developer Junior</h3>
                    <h4>Septembre - Avril 2019 / Becode.org / Charleroi</h4>
                    <h5>Formation centrée sur les technologies du web : Html, Css, JavaScript, PHP, Wordpress, Mysql & framework</h5>
                </div>
            </div>
            </div>   
        );
      }
}
